import React, { Component } from 'react';
import { Container, Col, Row, Navbar } from "react-bootstrap";
import "./Iam.css"
import me from '../../Assets/undraw_web_developer_re_h7ie.svg'

class Iam extends Component {

    render(){
        return(
            <div className='iam-container'>

                <h2>"Hello Shopify"</h2>
                <img src="/static/media/undraw_content_team_re_6rlg.f94ca9a5.svg" alt="Your SVG" style="height: 153px; width: 136px;"></img>
                <p className='longer-blurb'>I am a developer, I have worked with multiple different technologies in my path to be a developer. Here are some that I feel that would be relevent to this role.</p>

            </div>
        )}

}

export default Iam
